import React from 'react';

function Coffee({ name, picture }) {
  return (
  <div>
    <h3>Coffee:{name}</h3>
    <img src={picture} alt="img" />
  </div>
  );
};

const coffeeILike = [
  {
    name: "Americano",
    picture: "data:image/jpeg;base64,"
  },
  {
    name: "Capuccino",
    picture: "data:image/jpeg;base64,"
  }
];

function App() {
  return (
  <div>
    <h1>Hello World!</h1>
    {coffeeILike.map(
      coffee => (
        <Coffee name={coffee.name} picture={coffee.picture} />
      )  
    )};
  </div>
  );
   
};

export default App;
